(1, 'doc@docvisits.com', 'fcea920f7412b5da7be0cf42b8c93759', 1, 'DOC', 'Past', 1, '2016-01-29', '0', '4/32 Sterlling Height, MI 30342', 'Southfield', 'Oakland Count', '63086', '1233456788', 5, 'Average Rating\nRead reviews\nBook Online\nPractice Name\n\n    Neil Rosenthal, MD\n\nSpecialties\n\n    Neurologist\n\nProfessional Statement\n\nA native of New York, Dr. Rosenthal received his medical degree from the Cornell University Medical College, and went on to complete residencies in both Internal Medicine and Neurology, the former in Columbia University affiliated hospitals, and the latter at Mt. Sinai Medical Center. He is board certified by both the American Board of Internal Medicine, and the American Board of Psychiatry and Neurology. He has been in private practice since 1987, and is currently affiliated with both the Beth Israel Medical Center and New York University Hospitals Medical Center.\n\nDr. Rosenthal specializes in adult neurology. His goal as your physician will be to use his wide expertise in neurology to both diagnose and treat you. In his role as a physician he values knowledge, being comprehensive and thorough, sound judgment, common sense, honesty, and empathy.\n\nDr. Rosenthal and his staff look forward to welcoming you to his practice.\n\nIMPORTANT NOTICE: Be aware that Dr. Rosenthal''s office is not wheelchair accessible.\n\nIMPORTANT INSTRUCTIONS FOR NEW PATIENTS: If you want to speed up your first visit registration process, we encourage you to preregister by filling out the â€œCheck-Inâ€ form on the ZocDoc website. Also, be sure to bring the following: 1) your insurance card, 2) if required by your insurance company, a referral from your referring doctor, 3) an active credit card which we keep on file (although you will not be required to use it to pay for your visit copayment, coinsurance or deductible), 4) a list of your present medications, and 5) the name, telephone number, and zip code of your pharmacy (if you want us to be able to electronically submit your prescriptions directly to your pharmacist). ', '                                                                                                                                                                    fghdfghfhh', '                                                                                                                                                            gshgfshsghhghghsh', 'fhdfhdfhhsf', 'dfshhfdfhfdh', 'dfhdhshfds', '{"Mon":{"start":"08:00","ends":"14:00"},"Tue":{"start":"09:00","ends":"14:00"},"Wed":{"start":"09:00","ends":"13:00"},"Thu":{"start":"09:00","ends":"13:00"},"Fri":{"start":"09:00","ends":"14:00"},"Sat":{"start":"09:00","ends":"14:00"},"Sun":{"start":"09:00","ends":"18:00"}}', '{"Mon":{"start":"09:00","ends":"09:30"},"Tue":[{"start":"10:00","ends":"11:30"},{"start":"13:00","ends":"13:30"}],"Wed":{"start":"","ends":""},"Thu":{"start":"09:30","ends":"11:00"},"Fri":{"start":"09:30","ends":"11:00"},"Sat":{"start":"11:00","ends":"11:30"},"Sun":{"start":"10:00","ends":"17:30"}}', '[{"startdate":"2017-09-07","enddate":"2017-09-07","starttime":"09:00","endtime":"13:00"},{"startdate":"2016-07-12","enddate":"2016-07-13","starttime":"01:00","endtime":"02:00"},{"startdate":"2016-02-17","enddate":"2016-02-26","starttime":"10:00","endtime":"21:00"},{"startdate":"2016-02-27","enddate":"2016-02-28","starttime":"09:00","endtime":"16:00"},{"startdate":"2016-02-18","enddate":"2016-02-20","starttime":"10:00","endtime":"13:00"}]', '0000-00-00 00:00:00', '2016-03-30 02:43:26', '33355aa18efbc8b4f51625913c0e2f8b', '1'),
